import React from "react";
import LogoModatta from "../Assets/logo-header.png";
import { NavLink } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCog, faPowerOff } from "@fortawesome/free-solid-svg-icons";

class NavBar extends React.Component {
  state = {
    main: "",
  };
  render() {
    return (
      <div className="nav-bar">
        <div className="logo-box">
          <a href="/">
            <img src={LogoModatta} className="logo-modatta"></img>
          </a>
        </div>
        <div className="header-box">
          <div className="div-home-navbar"></div>
          <div className="personal-info">
            <p className="e-mail">bernardodmelo@gmail.com</p>
            <div className="settings-div">
              <NavLink to="/" className="navbar-item">
                <p>Settings</p>
              </NavLink>
              <FontAwesomeIcon icon={faCog} className="settings" color="#666" />
            </div>
            <div className="settings-div">
              <NavLink to="/" className="navbar-item">
                <p>LogOut</p>
              </NavLink>
              <FontAwesomeIcon
                icon={faPowerOff}
                className="log-out"
                color="#666"
              />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default NavBar;
